title: གངས་ཅན་ཡུལ་གྱི་ས་ལ་སྤྱོད་པའི་མཐོ་རིས་ཀྱི་རྒྱལ་བློན་གཙོ་བོར་བརྗོད་པའི་དེབ་ཐེར།
  རྫོགས་ལྡན་གཞོན་ནུའི་དགའ་སྟོན་དཔྱིད་ཀྱི་རྒྱལ་མོའི་གླུ་དབྱངས།
alternative-title:
- གངས་ཅན་ཡུལ་གྱི་ས་ལ་སྤྱོད་པའི་མཐོ་རིས་ཀྱི་རྒྱལ་བློན་གཙོ་བོར་བརྗོད་པའི་དེབ་ཐེར་༑་རྫོགས་ལྡན་གཞོན་ནུའི་དགའ་སྟོན་དཔྱིད་ཀྱི་རྒྱལ་མོའི་གླུ་དབྱངས།
- རྫོགས་ལྡན་གཞོན་ནུའི་དགའ་སྟོན།
- གངས་ཅན་ཡུལ་གྱི་ས་ལ་སྤྱོད་པའི་མཐོ་རིས་ཀྱི་རྒྱལ་བློན་གཙོ་བོར་བརྗོད་པའི་དེབ་ཐེར་རྫོགས་ལྡན་གཞོན་ནུའི་དགའ་སྟོན་དཔྱིད་ཀྱི་རྒྱལ་མོ་གླུ་དབྱངས།
